  SetFilterModalSendTemplate: param => {
    dispatch({
      type: 'SetFilterModalSendTemplate',
      payload: param
    });
  },
  SetFilterModalRecTemplate: param => {
    dispatch({
      type: 'SetFilterModalRecTemplate',
      payload: param
    });
  },
  SetDispDate: param => {
    dispatch({
      type: 'SetDispDate',
      payload: param
    });
  },
  SetCOD: param => {
    dispatch({
      type: 'SetCOD',
      payload: param
    });
  },
  SetInsureValue: param => {
    dispatch({
      type: 'SetInsureValue',
      payload: param
    });
  }
}))(Screen);

